      <div class = "step">
        <div class = "step_img">
          <img src = {Image1} />
        </div>
        <div class = "step-A">
          <div class = "title">
            {num}
          </div>
          <div class = "subtitle">
            subtitle about STEP subtitle about STEP subtitle about STEP
          </div>
        </div>
        <div class = "step-B">
          
        </div>
      </div>
    );
}


const Intro = () => {
  return (
    <div class = "intro">
        <div class = "left-box">
          class
        </div>
        <div class = "right-box">
          <Step num = "2" />
        </div>
    </div>
  );
}

export default Intro;
